&lt;p&gt;
	Energy consumption and cost are a continuing issue in the world, including JSC Buildings.&amp;nbsp; New technologies and designs in the commercial world have made available LED lighting tubes that can be easily retrofitted/replaced into standard fluorescent rod light fixtures found commonly in JSC offices/buildings.&amp;nbsp; While the upfront cost of the hardware exceeds standard fluorescent rods (by 2 to 4 times), the energy savings is quoted as up to 50&#37; or more.&amp;nbsp; The retrofit time/complexity is minimal, in that the ballast must be removed or bypassed, but the rods then fit into existing fixtures. The proposal is to evaluate and test at least two COTS versions of LED light rods, in a typical office area, for the factors of overall lighting quality, energy savings, labor time/cost for retrofit, and delta in maintenance required based on quoted hardware life expectancy vs. typical cost for repair/replacement of fluorescent&amp;nbsp; fixtures.&lt;/p&gt;
&lt;p&gt;
	This project completed retrofit of three typical office areas in Bldg. 7 with prototype LED rods from two vendors.&amp;nbsp; The measured savings in operating power was approximately 73&#37;, which did not include the savings for air conditioning from removal or bypass of the hot ballast.&amp;nbsp; The measured quality of the lighting (in Foot Candles at varying distance) was greater with the LED bulbs, without consideration to the fixture covering.&amp;nbsp; Retrofit was demonstrated as simple to implement.&amp;nbsp; The benefits of this technology are significant, and further study to implement this new technology into laboratories and other areas of JSC is recommended.&lt;/p&gt;
